import React from 'react';
import Logo from './Logo';

const NavBar = () => {
    return(
        <nav>
            <Logo />
            <a href="#">about</a> 
            <a href="#">work</a> 
            <a href="#">play</a> 
        </nav>
    )
}

export default NavBar;
